    "crescent-lake-national-wildlife-refuge-narrative-report-january-1-to-april-30-1959",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1959. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, reptiles, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments and wildfires. Resource management is outlined;
    topics include grazing, haying, and fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, and fishing.
    N-R forms, photographs, and newspaper articles are attached. A short narrative report
    of North Platte National Wildlife Refuge is included.",nt"license_title": "License
